  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tewaukon National
  Wildlife Refuge summarizes refuge activities from May through August of 1960.  The
  report begins with a summary of the weather and habitat conditions during this period.
  \ Wildlife- including migratory birds, upland game birds, big game animals, fur
  animals, predators, rodents, other mammals, predacious birds, fish, reptiles, and
  disease- is also covered.  The report includes a refuge development and maintenance
  section which discusses physical development, plantings, collections, receipts,
  and vegetation control.  Resources management is outlined; haying and special use
  permits were the primary resources used during this period.  A progress report on
  field investigation and applied research is also provided.  The public relations
  section of the report discusses recreational uses of the refuge, refuge visitors,
  and refuge participation.  Finally, items of interest, photographs, information
  on easements of the refuge, and N-R forms are provided.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
